import React, { useState, useEffect } from "react";
import "../css/style.css";
import avatar1 from "../assets/avatar4.jpeg";
import { Link } from "react-router-dom";
import axios from "axios";
import { useLocation } from "react-router-dom";
import Swal from "sweetalert2";
function Instructor() {
  const { search } = useLocation();
  const searchParams = new URLSearchParams(search);
  const passemail = searchParams.get("email");
  const [sname, setSName] = useState("");
  const [semail, setSEmail] = useState("");
  const [feedback, setFeedback] = useState("");
  const [name, setName] = useState("");
  const loadPrograms = async () => {
    fetch("https://sxt9335.uta.cloud/getName.php", {
      method: "POST",
      headers: {
        "Content-Type": "application/x-www-form-urlencoded",
      },
      body: `email=${passemail}`,
    })
      .then((response) => response.text())
      .then((data) => {
        setName(data);
      })
      .catch((error) => {
        console.error("Error:", error);
      });
  };
  useEffect(() => {
    loadPrograms();
  }, []);
  const [student, setStudent] = useState([]);

  const loadStudents = async () => {
    const studentResults = await axios.get(
      "https://sxt9335.uta.cloud/viewQuiz.php"
    );
    setStudent(studentResults.data.studentResults);
    console.log("inside studentResults view");
    console.log(studentResults.data.studentResults);
  };

  const handleStudentEdit = (student) => {
    console.log(student.email, "jhdsgjhsdgfjhfj");
    window.location.href = `/editQuiz?passemail=${passemail}&studentName=${student.studentName}&email=${student.email}&exam=${student.exam}&startTime=${student.startTime}&endTime=${student.endTime}&quizlink=${student.quizlink}`;
  };

  const handleGradeEdit = (student) => {
    console.log(student.email, "jhdsgjhsdgfjhfj");
    window.location.href = `/editGrade?passemail=${passemail}&studentName=${student.studentName}&email=${student.email}&grade=${student.grade}&percentage=${student.percentage}&resources=${student.resources}&quizlink=${student.quizlink}`;
  };
  useEffect(() => {
    loadStudents();
  }, []);

  const handleFormSubmit = (e) => {
    e.preventDefault();
    fetch("https://sxt9335.uta.cloud/feedbackform.php", {
      method: "POST",
      headers: {
        "Content-Type": "application/x-www-form-urlencoded",
      },
      body: `name=${sname}&email=${semail}&feedback=${feedback}`,
    })
      .then((response) => response.text())
      .then((data) => {
        if (data === "Email Sent") {
          Swal.fire(
            "Success!",
            "Your query has been sent successfully!",
            "success"
          ).then((result) => {
            if (result.isConfirmed) {
              window.location.href = `/instructor?email=${passemail}`;
            }
          });
        } else {
          alert(data);
          Swal.fire(
            "Oops!",
            "Failed to send email. Please try again.",
            "error"
          ).then((result) => {
            if (result.isConfirmed) {
              window.location.href = `/instructor?email=${passemail}`;
            }
          });
        }
      })
      .catch((error) => {
        console.error("Error:", error);
        Swal.fire(
          "Oops!",
          "An error occurred while sending the email.",
          "error"
        ).then((result) => {
          if (result.isConfirmed) {
            window.location.href = `/instructor?email=${passemail}`;
          }
        });
      });
  };
  return (
    <div className="stylecontainer">
      <div className="stylesidebar">
        <link
          rel="stylesheet"
          href="https://use.fontawesome.com/releases/v5.15.4/css/all.css"
          integrity="sha384-DyZ88mC6Up2uqS4h/KRgHuoeGwBcD4Ng9SiP4dIRy0EXTlnuz47vAwmeGwVChigm"
          crossOrigin="anonymous"
        />
        <ul>
          <li>
            <Link to="/home">
              <i className="fas fa-book"></i>
              <div className="styletitle">SkillBridge</div>
            </Link>
          </li>
          <li>
            <a href="#">
              <i className="fas fa-th-large"></i>
              <div className="styletitle">Instructor Dashboard</div>
            </a>
          </li>
          <li>
            {/* <a href="#">
              <i className="fas fa-tag"></i>
              <div className="styletitle">Assessment Creation</div>
            </a> */}
            <Link to={`/assessment?email=${passemail}`}>
              <i className="fas fa-user"></i>
              <div className="styletitle">Assessment Creation</div>
            </Link>
          </li>
          <li>
            <Link to={`/edit?email=${passemail}`}>
              <i className="fas fa-user"></i>
              <div className="styletitle">Edit Profile</div>
            </Link>
          </li>
          <li>
            <Link to={`/messagechat?name=${name}`}>
              <i className="fas fa-user"></i>
              <div className="styletitle">WebChat</div>
            </Link>
          </li>
          <li>
            <Link to="/login">
              <i className="fas fa-user"></i>
              <div className="styletitle">Logout</div>
            </Link>
          </li>
        </ul>
      </div>
      <div className="stylemain">
        <div className="styletop-bar">
          <div className="stylesearch">
            <input type="text" name="search" placeholder="Search here.." />
            <label htmlFor="search">
              <i className="fas fa-search"></i>
            </label>
          </div>
          <i className="fas fa-bell"></i>
          <div className="styleuser">
            <img src={avatar1} alt="skillbridge" />
          </div>
        </div>
        <div className="stylecards">
          <div className="stylecard">
            <div className="stylecard-content">
              <div className="stylenumber">5</div>
              <div className="stylecard-name">Roles</div>
            </div>
            <div className="styleicon-box">
              <i className="fas fa-tag"></i>
            </div>
          </div>
          <div className="stylecard">
            <div className="stylecard-content">
              <div className="stylenumber">67</div>
              <div className="stylecard-name">Courses</div>
            </div>
            <div className="styleicon-box">
              <i className="fas fa-tag"></i>
            </div>
          </div>
          <div className="stylecard">
            <div className="stylecard-content">
              <div className="stylenumber">5</div>
              <div className="stylecard-name">Exams</div>
            </div>
            <div className="styleicon-box">
              <i className="fas fa-tag"></i>
            </div>
          </div>
          <div className="stylecard">
            <div className="stylecard-content">
              <div className="stylenumber">7</div>
              <div className="stylecard-name">Assignments</div>
            </div>
            <div className="styleicon-box">
              <i className="fas fa-tag"></i>
            </div>
          </div>
        </div>
        <div className="styletables">
          {/* Student Grading and Tracking */}
          <div className="StyleAllRoles">
            <div className="styleheading">
              {/* <Link to={`/addCourses?email=${email}`} className="stylebtn">
                Add Course
              </Link> */}
              <h2>Students Enrolled</h2>
              <a href="#" className="stylebtn">
                View All
              </a>
            </div>
            <table className="styleroles">
              <thead>
                <tr>
                  <th>Student Name</th>
                  <th>Student Email</th>
                  <th>Course ID</th>
                  <th>Course Name</th>
                  <th>Professor Name</th>
                  <th>Course Period</th>
                  <th>Action</th>
                </tr>
              </thead>
              <tbody>
                {student.map((res, index) => {
                  if (res.studentName !== null && res.professorName === name) {
                    return (
                      <tr key={index}>
                        <td>{res.studentName}</td>
                        <td>{res.email}</td>
                        <td>{res.courseId}</td>
                        <td>{res.courseName}</td>
                        <td>{res.professorName}</td>
                        <td>{res.period}</td>
                        <td>
                          <i className="fas fa-eye"></i>
                          &nbsp;
                          <i
                            className="fas fa-edit"
                            onClick={() => handleStudentEdit(res)}
                          ></i>
                          &nbsp;
                          {/* <i className="fas fa-trash" onClick={() => handleDelete(res.course_id)}></i> */}
                          &nbsp;
                        </td>
                      </tr>
                    );
                  }
                  return null; // If studentName is null, return null to skip rendering
                })}
              </tbody>
            </table>
          </div>
          {/* Student Grading and Tracking */}
          {/* Grades */}
          <div className="StyleAllRoles">
            <div className="styleheading">
              <h2>Manage Grades and Track Progress</h2>
              <a href="#" className="stylebtn">
                View All
              </a>
            </div>
            <table className="styleroles">
              <thead>
                <tr>
                  <th>S No</th>
                  <th>Student Name</th>
                  <th>Student Email</th>
                  <th>Grade</th>
                  <th>Overall %</th>
                  <th>Resources</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {student.map((res, index) => {
                  if (res.studentName !== null && res.professorName === name) {
                    return (
                      <tr key={index}>
                        <td>{index + 1}</td>
                        <td>{res.studentName}</td>
                        <td>{res.email}</td>
                        <td>{res.grade}</td>
                        <td>{res.percentage}</td>
                        <td>{res.resources}</td>
                        <td>
                          <i className="fas fa-eye"></i>
                          &nbsp;
                          <i
                            className="fas fa-edit"
                            onClick={() => handleGradeEdit(res)}
                          ></i>
                          &nbsp;
                          {/* <i className="fas fa-trash" onClick={() => handleDelete(res.course_id)}></i> */}
                          &nbsp;
                        </td>
                      </tr>
                    );
                  }
                  return null; // If studentName is null, return null to skip rendering
                })}
              </tbody>
            </table>
          </div>
          {/* Grades */}
        </div>
        <div className="stylefeedback">
          <div className="stylefeedback1">
            <h1>Provide Update</h1>
            <form onSubmit={handleFormSubmit}>
              <input
                onChange={(e) => setSName(e.target.value)}
                type="text"
                placeholder="Student Name"
              />
              <input
                type="email"
                onChange={(e) => setSEmail(e.target.value)}
                placeholder="Student UTA Email ID"
              />
              <textarea
                onChange={(e) => setFeedback(e.target.value)}
                placeholder="Your Feedback..."
              ></textarea>
              <button type="submit">Send Update</button>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Instructor;
